import React, { Component } from 'react';

class GroceryList extends Component{
  constructor(props) {
    super(props);
    this.state = {added_elements:['one']};
  }
  render(){
    return(
      <div>this.state.added_elements[0]</div>
    );
  }
}


export default GroceryList;
